   var startTextAlign = function (i,side) {
        var e = $("#box" + i + side);

        var $height = e.height();
        var ph = e.parent().parent().height();
        var top = (ph - $height)/1.25;
        var $width = e.width();
        var pw = e.parent().parent().width();
        var left = (pw - $width) / 2;
        e.css('top', top + 'px');
        e.css('left', left + 'px');
    }


